products.name:
Набор  реагентов  для  фотометрического  определения  содержания  глюкозы в  сыворотке  и  плазме  ферментативным  методом.                                                                                                      Состав набора: 
10  таблеток  ферменто-хромогенной  смеси; 
10  таблеток антикоагулянта; 
1 флакон калибратора.
Россия

Набор  реагентов  для  фотометрического  определения  содержания  глюкозы в  сыворотке  и  плазме  ферментативным  методом. 
Состав набора: 
10  таблеток  ферменто-хромогенной  смеси; 
10  таблеток антикоагулянта; 
1 флакон калибратора.
Россия

Материал пробирки пластик; 
Крышка пробирки из пластика фиолетового цвета, пробирка и крышка имеют V-образную резьбу, обеспечивающую антиаэрозольный эффект при снятии крышки,
наличие у пробирки юбки устойчивости; 
Наличие у пробирки лотка-выступа позволяющего забрать кровь самотеком.
Наличие антикоагулянта калиевой соли ЭДТА К3 на внутренних стенках пробирки в мелкодисперсном виде; 
Наличие прозрачной этикетки с указанием: знака стерильности и способа стерилизации, знака однократности применения, объема пробирки, состава наполнителя, срока годности, номера лота, точной отметки уровня наполнения; 
Размер пробирки  10*45 мм, 
Объем пробы  200 мкл (0,2 мл); 
Область применения: гематология; 
Упаковка пробирок –  50 шт. в пенопластовом штативе, запаянном в полиэтилен.  
На этикетке упаковки содержится информация о сроке годности, дате изготовления, номере лота, стерильности и способе стерилизации, объёме пробирки, наполнителе, размере пробирки, условиях хранения, импортере; номер регистрационного удостоверения.
Продукция зарегистрирована на территории РФ.
Китай

